Episode Title: &quot;Judge Judy Primetime&quot;
Original Air Date: May 20, 2014

&quot;A close-up on Judge Judy Sheindlin and her TV series 'Judge Judy' includes new cases and a look at Sheindlin's transition from New York family-court judge to TV star. Also: The no-nonsense judge's one-liners are highlighted. Hosted by Samuel L. Jackson.&quot;

Seed and enjoy!
